import data from "../data"; 

const testData = data;

const Display = (props)=> {
    let country = props.country;

    return (
        <div className="flex-containercountry">
            <div className="flex-itemscountry">
                <img alt="country" src={testData.flags.png}></img>
                <h1>{testData.name.offical}</h1>
                <h3>Population: {testData.population}</h3>
                <h3>Region: {testData.region}</h3>
                <h3>Capital: {testData.capital[0]}</h3>
            </div>
        </div>
        );

} 

export default Display;
